import React from 'react';
import Link from 'next/link';

const NoticeList = (props, {onChage}) => {



    return (
        props.map(
            list => <Link href={{pathname:'/noticeInfo', query:{NTC_ID:list.NTC_ID}}}><li key={list.NTC_ID}>{list.NTC_TITLE}</li></Link>
        )
    )
};

export default NoticeList;
